// FileList.js
import React from 'react';

const FileList = ({ files, onFileUpload }) => {
    return (
        <div>
            {files.map((file, index) => (
                <div key={index}>
                    <span>{file.fileName} - {file.date}</span>
                </div>
            ))}
            {/* Upload functionality can be implemented here or in the parent component */}
        </div>
    );
};

export default FileList;
